# Use only if recreating and it exists
# drop the database (if needed to recreate)
DROP DATABASE assignment_04_db;

# Create the database
create database assignment_04_db;

# Use this database for these statements
use assignment_04_db;

# create the customers table
CREATE TABLE Customers (
    CustomerId int not null auto_increment,	# surrogate key
    CustomerNumber varchar(255) not null,			# represents what customers see on account page Letter Sequence  + Number Sequence
    LastName varchar(255) not null,
    FirstName varchar(255) not null,
    MiddleName varchar(255),
    AddressLine1 varchar(255) not null,
    AddressLine2 varchar(255),
    AddressCity varchar(255) not null,
    AddressState varchar(2) not null,
    AddressZipCode varchar(10) not null,
    DeliveryNotes varchar(255),
    SignUpDate date not null,
    primary key (CustomerId)
);

# create the products table
CREATE TABLE Products (
	ProductId int not null auto_increment,	# surrogate key
    ProductNumber varchar(255) not null,	# represents the catalog id used Letter Sequence  + Number Sequence
    ProductName varchar(255) not null,
    ProductDescription varchar(255) not null,
    CurrentPrice float not null,
    DateAdded date not null,
	primary key (ProductId)
);

# create the registered warranty table
CREATE TABLE CustomerProductWarranties (
	CustomerProductWarrantyId int not null auto_increment,	# surrogate key
    CustomerId int not null,
    ProductId int not null,
    DateRegistered date not null,
    DateEnds date not null,
	primary key (CustomerProductWarrantyId),
    constraint FK_CustomerId
    FOREIGN KEY (CustomerId) REFERENCES Customers(CustomerId),
    constraint FK_ProductId
    FOREIGN KEY (ProductId) REFERENCES Products(ProductId)
);

